const Overall = ({ thing, light = false }) => {
  return (
    <section
      className={`min-h-[50vh] padding-x pb-96 ${
        light ? "bg-slate-100" : "bg-slate-950"
      }`}
    >
      Overall
    </section>
  );
};

export default Overall;
